import React, { Component } from 'react';

export class Footer extends Component {
    render() {
        return (
            <footer>
                <p>Created by Wensi Xu, Larry Li, Jason Weng, and Yixuan Wen</p>
                <address>
                    Contact us at <a href="huskiefinder@uw.edu">huskiefinder@uw.edu</a>, or at <a href="tel:484-123-4567">484-123-4567</a>.
                    </address>
                <p>&copy; 2020</p>
            </footer>
        )

    }
}
